import React from 'react';
import styled from 'styled-components';

const MainNav = styled.div`
    background-color: #333333;
    display: flex;
    flex-direction: row;
`

export default function NavWrapper() {
    return (
        <MainNav>
            hey.
        </MainNav>
    );
}
